import React from "react"
import { Route, Routes } from "react-router-dom";
import Navbar from "./Navbar";

const App = () => {
  return (
    <>
    <Navbar/>
    <Routes>
      <Route path="/about_us_2" exact />
      <Route path="/blogright" exact />
      <Route path="/contact" exact />
      <Route path="/faq" exact />
      <Route path="/projectdetail" exact />
      <Route path="/servicedetails" exact />
      <Route />
    </Routes>
    </>
    );
}

export default App;
